import React from 'react';

function ProductList({item: shoes}) {
    const { image, name, price } = shoes;
    return (
        <div className="m-auto row-cols-lg-3 col-md-5 border"  style={{height: 500}}>
            <img src={ image } alt={ name } style={{height: 300}}/>
            <div>
                <h3>{ name }</h3>
                <p>{ price }</p>
            </div>
        </div>
    );
}

export default ProductList;
